import logo from './logo.svg';
import { Route, useHistory, Routes, Redirect } from 'react-router-dom';
import './App.css';
import Register from '../Register/Register'

function App() {
  return (
    <div className="page">
      <Routes>
      <Route path='/signup'>
      <Register />
      </Route>
      </Routes>
    </div>
  );
}

export default App;
